import React from 'react';
import HeaderWithSidebar from '../Sidebar';

function PESU() {
  return(
    <div>
    <HeaderWithSidebar />
    <iframe src="https://www.pesuacademy.com/Academy/" width="1490px" height="788px" title="pesu"></iframe>
    </div>
  );
}

export default PESU;
